DROP TABLE IF EXISTS `siege_guards`;
CREATE TABLE `siege_guards` (
  `location` varchar(35) NOT NULL default '',
  `unitId` int NOT NULL default 0,
  `id` int NOT NULL auto_increment,
  `npcId` int NOT NULL default 0,
  `x` int NOT NULL default 0,
  `y` int NOT NULL default 0,
  `z` int NOT NULL default 0,
  `heading` int NOT NULL default 0,
  `respawnDelay` int NOT NULL default 0,
  `isHired` int NOT NULL default 1,
  `loc_id` int(11) NOT NULL default 0,
  PRIMARY KEY  (`id`),
  KEY `id` (`unitId`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;




























